import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Container, Grid, Button } from '@mui/material';
import { ThemeProvider } from './components/ThemeContext';
import Login from './components/Login';
import Signup from './components/Signup';
import Profile from './pages/Profile';
import Navbar from './components/Navbar';
import Dashboard from './pages/Dashboard';
import CoursePage from './pages/CoursePage';
import MentorshipPage from './pages/MentorshipPage';
import Feedback from './components/Feedback';
import Contact from './components/Contact';
import About from './components/About';
import Footer from './components/Footer';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    const token = sessionStorage.getItem('token');
    setIsLoggedIn(!!token);
  }, []);

  return (
    <ThemeProvider>
      <Router>
        <Navbar isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
        <Container maxWidth="sm">
          <Grid container spacing={2} alignItems="center" justify="center" style={{ minHeight: '100vh' }}>
            <Grid item xs={12}>
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login setIsLoggedIn={setIsLoggedIn} />} />
                <Route path="/signup" element={<Signup setIsLoggedIn={setIsLoggedIn} />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/profile" element={<Profile />} />
                <Route path="/courses" element={<CoursePage />} />
                <Route path="/mentorship" element={<MentorshipPage />} />
                <Route path="/feedback" element={<Feedback />} />
                <Route path="/contact" element={<Contact />} />
                <Route path="/about" element={<About />} />
              </Routes>
            </Grid>
          </Grid>
        </Container>
        <Footer />
      </Router>
    </ThemeProvider>
  );
}

function Home() {
  return (
    <Grid container spacing={2} direction="column" alignItems="center">
      <Grid item>
        <h1>Welcome to Student Hub</h1>
      </Grid>
      <Grid item>
        <Button variant="contained" color="primary" href="/signup">Sign Up</Button>
      </Grid>
      <Grid item>
        <Button variant="contained" color="secondary" href="/login">Log In</Button>
      </Grid>
    </Grid>
  );
}

export default App;
